  input: TEXT,F3XA,,"We did not receive letter from FEC dated 01/22/2003. All funds
    received from political committees not registered with the FEC were donations
    totalling $1000 or less and were from federally permissable funds. The contribution
    from the Cuyahoga County Democratic Party was from a check that was labelled 'Federal
    Account'. The chcek from Franklin County was from their tax check-off funds, all
    permissable funds. On January 3, 2002 we transferred in $ 55,704.85 from a non-federal
    account matching expenditures made within the 60 day limit going back into 2001.
    This should account for the year to date totals appearing to be excessive. All
    transfers were within the 70 day time period. SD2002 was a new activity (typo).
    All disbursement for 'supples' were 'Office supplies' not for any specific federal
    candidate. All disbursements for 'mail services' were for sample ballots which
    qualified as exempt activities."
